  const [pic, setpic] = useState();

  return (
    <div>
      <div class="mb-3">
        <label for="emailinputarea" class="form-label">
          Email address
        </label>
        <input
          type="email"
          class="form-control"
          id="emailinputarea"
          placeholder="name@example.com"
        ></input>
      </div>
      <div class="mb-3"></div>
    </div>
  );
};

